goog.provide("goog.events.WheelEvent");goog.require("goog.asserts");goog.require("goog.events.BrowserEvent");goog.events.WheelEvent=function(browserEvent,deltaMode,deltaX,deltaY,deltaZ){goog.events.WheelEvent.base(this,"constructor",browserEvent);goog.asserts.assert(browserEvent,"Expecting a non-null browserEvent");this.type=goog.events.WheelEvent.EventType.WHEEL;this.deltaMode=deltaMode;this.deltaX=deltaX;this.deltaY=deltaY;this.deltaZ=deltaZ;var pixelRatio=1;switch(deltaMode){case goog.events.WheelEvent.DeltaMode.PAGE:pixelRatio*=goog.events.WheelEvent.PIXELS_PER_PAGE_;break;case goog.events.WheelEvent.DeltaMode.LINE:pixelRatio*=goog.events.WheelEvent.PIXELS_PER_LINE_;break;}this.pixelDeltaX=this.deltaX*pixelRatio;this.pixelDeltaY=this.deltaY*pixelRatio;this.pixelDeltaZ=this.deltaZ*pixelRatio};goog.inherits(goog.events.WheelEvent,goog.events.BrowserEvent);goog.events.WheelEvent.EventType={WHEEL:"wheel"};goog.events.WheelEvent.DeltaMode={PIXEL:0,LINE:1,PAGE:2};goog.events.WheelEvent.PIXELS_PER_LINE_=15;goog.events.WheelEvent.PIXELS_PER_PAGE_=30*goog.events.WheelEvent.PIXELS_PER_LINE_;